import styled from 'styled-components';

export const Container = styled.p`
    display: flex;
    flex-wrap: wrap;
    align-content: flex-start;
    align-items: flex-start;
    justify-content: flex-start;
    outline-style: solid;
    height: 8rem;
`;

export const Label = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 24px;
    outline-style: solid;
    width: 50%;
    display: flex;
`;
export const Slider = styled.input`
    color: #000000;
    outline-style: solid;
    width: 100%;
`;

export const Result = styled.p`
    color: #F7B718;
    font-family: "poppins";
    outline-style: solid;
    font-size: 40px;
    width: 50%;
    display: flex;
`;

export const ContainerLabels = styled.p`
    display: flex;
`;
